column8:
“Child Safety is our passion (子供の安全こそ我々の情熱である)”という観点から開発された革新的なジュニアシート。<br>
安全基準UN R44/04に適合した安全性を備えつつ、圧倒的なコンパクトさと重量約700ｇというポータビリティで、<br>体重15kg以上 36kg以下のお子さまを持つファミリーの快適なおでかけを、よりスマートにします。<br><br>

サイズ：W23.5×D12×H4.5cm（折りたたみ時）<br>
重量：700g<br>
原産国：中国<br>
材質：シート部：EVA・ハードカバー部：ポリプロピレン<br>
腰ベルトガイド：POM<br>
肩ベルトガイドストラップ：ポリプロピレン<br>
腰ベルトガイド金属部：鉄<br>
月齢：15kg以上36kg以下のお子さま目安：3才から11才頃
 <br><br>

